import React from 'react';
import './App.css';

import Header from './Header'
import Footer from './Footer'

import 'bootstrap/dist/css/bootstrap.min.css';

import 'react-toastify/dist/ReactToastify.css';
import Example from './example';
import Course from './Course';

function App() {
  return (
    <div className="App">
      <Header title="1st head" />
      <Course Course ={ {title:"Dango COurse" , info:"This is a Dango Course" }}
      />
      <Course Course ={ {title:"Java COurse" , info:"This is a Java Course" }}
      />
      <Course Course ={ {title:"Python COurse" , info:"This is Python Course" }}
      />
      <Course Course ={ {title:"c/c++ COurse" , info:"This is a c/c++ Course" }}
      />
      <Example/>

      <Footer name="kazi" />
    </div>
  );
}

export default App;
